import React from 'react';
import axios from "axios";

function Test()
{
    const token = "Bearer " + window.sessionStorage.getItem("token")
    const res = axios.get("http://127.0.0.1:5000/user/test", token)

    return <div>{res}</div>
}

export default Test;
